b"(This is a public version of the event posted in the Iowa City DSA Facebook Group).
It's time to get started - our next meeting will be at 12pm, on May 20th (next Saturday). Aside from some initial housekeeping (finalizing and passing the bylaws, etc.), this meeting will be when we start discussing and planning out actions for our chapter, so we hope to see as many of you there as possible. The Executive Committee has identified some potential avenues for building an activist and political presence within our community that we're excited to share with you, though the majority of this meeting will be an open floor during which the chapter will deliberate and decide upon a course of action for our first steps as a chapter.
Questions, comments, or concerns can be posted on this page or directed to Rose Fiala (
